/// <summary>
///    Adds the given selection to the batch merge during initialization.
/// </summary>
/// <param name="_selection">
///    A <c>InventBatchMergeSelection</c> containing the item and inventory dimensions to select.
/// </param>
private void addSelectionOnInit(InventBatchMergeSelection _selection)
{
    InventDimGroupSetup inventDimGroupSetup = InventDimGroupSetup::newItemId(_selection.parmItemId());
    InventDimParm       inventDimParm;

    inventBatchJournal.ItemId = _selection.parmItemId();
    this.onItemChanged();

    inventDimParm.setAllInventDim();
    inventDimParm.clearTrackingDimensions();
    inventDimJournal.copyDimParmDim(inventDimGroupSetup, _selection.parmInventDim(), inventDimParm);
    inventDimJournal.deduceMissingDimensions();

    if (_selection.parmInventDim().InventBatchId
        && formControl.areMandatorySelectionFieldsFilled()
        && formControl.journalController().validateSourceBatch(_selection.parmInventDim().InventBatchId))
    {
        inventBatchJournal_ds.write();
        formControl.journalController().addInventBatchId(_selection.parmInventDim().InventBatchId);
        this.onSourceChanged(true);
    }
}

public boolean canClose()
{
    if (numberSeqFormHandler)
    {
        numberSeqFormHandler.formMethodClose();
    }

    return super();
}

public void close()
{
    FormDataSource  callerDataSource;
    FormRun         caller;

    if (element.args() &&
        element.args().dataset() == tableNum(InventBatchJournal) &&
        FormDataUtil::getFormDataSource(element.args().record()))
    {
        caller = element.args().caller() as FormRun;
        if (caller &&
            caller.args())
        {
            caller.args().lookupRecord(inventBatchJournal);
        }
        callerDataSource = FormDataUtil::getFormDataSource(element.args().record());
        callerDataSource.research();
    }

    super();
}

