public void onAttributePageChange()
{
    InventBatchJournalAttribute inventBatchJournalAttribute;
    int                         numAttributesPerPage = InventBatchJournalAttribute::attributesPerPage();
    int                         i;
    FormStringControl           sourceControl;
    FormStringControl           resultControl;
    ListEnumerator              sourceControlEnumerator;
    ListEnumerator              resultControlEnumerator;
    boolean                     columnExists;

    inventBatchJournalAttribute = InventBatchJournalAttribute::find(inventBatchJournal.RecId, attributePage);

    sourceControlEnumerator = sourceAttributeControls.getEnumerator();
    resultControlEnumerator = resultAttributeControls.getEnumerator();
    for (i = 1; i <= numAttributesPerPage; i++)
    {
        columnExists = sourceControlEnumerator.moveNext();
        Debug::assert(columnExists);
        columnExists = resultControlEnumerator.moveNext();
        Debug::assert(columnExists);

        sourceControl = sourceControlEnumerator.current();
        resultControl = resultControlEnumerator.current();

        if (inventBatchJournalAttribute.AttributeId[i])
        {
            sourceControl.visible(true);
            resultControl.visible(true);
            sourceControl.label(inventBatchJournalAttribute.AttributeId[i]);
            resultControl.label(inventBatchJournalAttribute.AttributeId[i]);
        }
    }

    inventBatchJournalSource_ds.executeQuery();
    inventBatchJournalResult_ds.executeQuery();

    prevAttributeGroupButton.visible(numAttributePages > 1);
    nextAttributeGroupButton.visible(numAttributePages > 1);
    if (numAttributePages > 1)
    {
        prevAttributeGroupButton.enabled(attributePage > 1);
        nextAttributeGroupButton.enabled(attributePage < numAttributePages);
    }
}

private void onItemChanged(boolean activeRecordChanged = false)
{
    boolean         isCWItem            = PdsGlobal::pdsIsCWItem(this.itemId());
    InventDimParm   inventDimParm;

    formControl.onItemChanged(activeRecordChanged);

    cwUnitId.visible(isCWItem);
    inventBatchJournalSource_ds.object(fieldNum(InventBatchJournalSource, cwInventQty)).visible(isCWItem);
    inventBatchJournalResult_ds.object(fieldNum(InventBatchJournalResult, cwInventQty)).visible(isCWItem);

    inventDimParm.setAllInventDim();
    inventDimParm.clearProductDimensions();
    formControl.setEditPropertyForInventDimFields(inventDimResult_ds, inventDimParm);

    this.setMandatoryForMergedBatchDimensions();

    this.refreshAttributes();
    this.onSelectionFieldModified();
}

public void onSelectionFieldModified()
