}

public void onSourceChanged(boolean _rereadSource = true)
{
    boolean hasSource = InventBatchJournalSource::existForJournal(inventBatchJournal.RecId);

    formControl.updateSelectionControls();

    refreshButton.enabled(!inventBatchJournal.Posted && hasSource);
    inventBatchJournalSource_ds.allowDelete(!inventBatchJournal.Posted);

    if (_rereadSource)
    {
        inventBatchJournalSource_ds.research();
    }
    element.updateResultDataSource();
}

