private void setMandatoryForMergedBatchDimensionField(FieldId _fieldId)
{
    FormDataObject  formDataObject = inventDimResult_ds.object(_fieldId);
    formDataObject.mandatory(formDataObject.allowEdit());
}

private void setMandatoryForMergedBatchDimensions()
{
    InventNumGroup  inventNumGroup = InventNumGroup::find(inventBatchJournal.inventTable().BatchNumGroupId);
    DictFieldGroup  dictFieldGroup = new DictFieldGroup(tableNum(InventDim), tableFieldgroupStr(InventDim, BatchHandlingResultDimensions));
    int             i;

    for (i = dictFieldGroup.numberOfFields(); i > 0; i--)
    {
        this.setMandatoryForMergedBatchDimensionField(dictFieldGroup.field(i));
    }

    inventDimResult_ds.object(fieldNum(InventDim, InventBatchId)).mandatory(!inventNumGroup.RecId || inventNumGroup.ManualAllocation);

    // Whether LicensePlateId is mandatory or not is dependent on the resulting location.
    // The transfer journals logic validates this.
    inventDimResult_ds.object(fieldNum(InventDim, LicensePlateId)).mandatory(false);
}

/// <summary>
///    Updates the form design when there are changes that could affect the dimension display.
/// </summary>
/// <param name="_mode">
///    The inventory dimension design update mode.
/// </param>
/// <exception cref="Exception::Error">
///    Thrown if the <paramref name="_mode"/> is not supported by this method.
/// </exception>
public void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm       inventDimParm;
    InventDimParm       inventDimParmFilter;
    InventDimGroupSetup inventDimGroupSetup;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl::newFromFormValidDataSource(element, inventDimSource_ds.name());

                inventDimParm.setAllProductDimensions();
                inventDimParm.InventSiteIdFlag      = NoYes::Yes;
                inventDimParm.InventLocationIdFlag  = NoYes::Yes;
                inventDimParm.InventBatchIdFlag     = NoYes::Yes;
                inventDimFormSetup.parmDimParmLockedRightClick(inventDimParm.data());

                inventDimParm.clear();
                inventDimParm.InventBatchIdFlag     = NoYes::Yes;
                inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            }
            inventDimFormSetup.formSetControls(true, true);
            break;

        case InventDimFormDesignUpdate::Active:
            inventDimGroupSetup = InventDimGroupSetup::newItemId(this.itemId());
            inventDimParm.initFromInventDimFieldList(inventDimGroupSetup.activeFields());
            inventDimParmFilter.initFromInventDim(inventDimJournal);
            inventDimParmFilter.toggleAllInventDim();
            inventDimParm = InventDimParm::andParms(inventDimParm, inventDimParmFilter);
            inventDimParm.InventBatchIdFlag = NoYes::Yes;
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm, true);

            inventDimFormSetup.formSetControls(false, true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public void updateResultDataSource()
{
    int     numBatches      = formControl.journalController().sourceBatchCount();
    boolean canEditResult   = !inventBatchJournal.Posted && numBatches > 1;

    inventBatchMergeJournalTransfer.enabled(canEditResult);
    inventBatchMergeJournalPost.enabled(canEditResult);

    inventBatchJournalResult_ds.research();
    if (numBatches == 0)
    {
        inventDimResult.clear();
        inventDimResult_ds.refresh();
    }
    inventBatchJournalResult_ds.research();
    inventBatchJournalResult_ds.allowEdit(canEditResult);
    inventDimResult_ds.allowEdit(canEditResult);
}

