public void init()
{
    QueryBuildDataSource    dsInventBatchJournal;
    QueryBuildDataSource    ds;
    int                     i;

    if (!(element.args().dataset() == tableNum(InventBatchJournal)
        || element.args().lookupTable() == tableNum(InventBatchJournal)))
    {
        this.autoSearch(false);
    }

    super();

    // Disable the outer join to the InventBatchJournal table that comes from the list page as that causes performance problems when included here
    if (this.autoSearch() && element.args().copyCallerQuery() == CopyCallerQuery::Yes)
    {
        dsInventBatchJournal = this.queryBuildDataSource();
        for (i = 1; i <= dsInventBatchJournal.childDataSourceCount(); i++)
        {
            ds = dsInventBatchJournal.childDataSourceNo(i);
            if (ds.table() == tableNum(InventJournalTable) && ds.joinMode() == JoinMode::OuterJoin)
            {
                ds.enabled(false);
            }
        }
    }

    formControl.onInventBatchJournalInit(inventBatchJournal);
}

