public void deleteMarked()
{
    MultiSelectionHelper        multiSelectionHelper = MultiSelectionHelper::construct();
    InventBatchJournalSource    source;

    if (Box::yesNo("@SYS100114", DialogButton::No, "@SYS24848") == DialogButton::Yes)
    {
        multiSelectionHelper.parmDatasource(this);

        ttsbegin;

        source = multiSelectionHelper.getFirst();
        while (source.RecId)
        {
            source.delete(false);
            source = multiSelectionHelper.getNext();
        }

        formControl.journalController().onSourceLinesDeleted();

        ttscommit;

        element.onSourceChanged(true);
    }
}

