private void addInventBatchId()
{
    formControl.onBatchAdded();

    InventBatchId batchToAdd = inventBatchIdSelect.text();
    if (batchToAdd != "" && formControl.journalController().validateSourceBatch(batchToAdd))
    {
        inventBatchJournal_ds.write();
        formControl.journalController().addInventBatchId(batchToAdd);
        element.onSourceChanged();
    }

    inventBatchIdSelect.text('');
}

